import React from "react";
import styled from "styled-components";

import Garden from '../components/Garden'

const Container = styled.div`
    background: red;
    height: 100vh;
`

const Main = () => {
  return (
    <Container>
      <Garden />
    </Container>
  );
};

export default Main;
